import { connect } from 'react-redux';
import OrdersHistory from '../components/OrdersHistoryComponent';

const ConnectedOrdersHistoryComponent = connect(
  (state) => ({
    pages: state,
  }),
)(OrdersHistory);

export default ConnectedOrdersHistoryComponent;
